import {createApiRequest} from "./index";


export const uploadfile = (data) => {
    return createApiRequest({
        url: `/wortwhile/uploadfile`,
        data: {data},
        method: 'post'
    })
}
export const getTime = (data) => {
    return createApiRequest({
        url: `/time`,
        data: {},
        method: 'get'
    })
}

export const wortwhile = (data) => {
    return createApiRequest({
        url: `/wortwhile/uploadfile`,
        data: {data},
        method: 'post'
    })
}
